    // across environments. This needs to be done _before_ including the Optimizely JS file
    //
    // @see
    // http://developers.optimizely.com/javascript/reference/#set-cookie-domain
    // window.optimizely.push(['setCookieDomain', 'www.creativelive.com']);

    _.each(rind.context.buckets.list, function(variation) {
      // add this visitor with experiment/variation information
      // to the optimizely stack.
      window.optimizely.push(['bucketVisitor', variation.experiment_id, variation.id]);
      // and activate the experiment. Setting the experiment to "Manual"
      // activation mode ensures that this behavior is consistent.
      // https://help.optimizely.com/hc/en-us/articles/200040225-Activation-Mode-Activating-an-experiment-dynamically-after-a-page-has-loaded
      window.optimizely.push(['activate', variation.experiment_id]);
      logExperiment(variation.experiment_id, variation.id);
    });

    // all our optimizely stuff is ready,
    // so now we can finally bootstrap angular.
    window.__bootstrapAngular();
  })
  .wait(function() {
    // for each experiment listed in the optimizelyBuckets cookie, send
    // an Experiment Viewed call. We read the cookie so that we get
    // "manual" experiments (which we parse on the servrer) and "immediate"
    // experiments, which are handled entirely by optimizely.
    try {
      var optimizelyCookieData = JSON.parse(decodeURIComponent(Vault.Cookie.get('optimizelyBuckets')));
      angular.forEach(optimizelyCookieData, function(variationId, experimentId) {
        var experimentIdInt = parseInt(experimentId, 10);
        if (window.optimizely.activeExperiments.indexOf(experimentId) >= 0 || window.optimizely.activeExperiments.indexOf(experimentIdInt) >= 0) {
          logExperiment(experimentId, variationId);
        }
      });
    } catch (e) {
      console.warn('Did not send Experiment Viewed Analytics Event', e);
    }
  })
}
