icy describes what personal information we may collect from you through the Service, and how we may use that information.  References to “we,” “us,” and “our” refer to CreativeLive, Inc.  Capitalized terms used but not defined in this Privacy Policy are as defined in our <a href=\"terms\">Terms of Use</a>).</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <h2 class=\"col-sm-8\">COLLECTING AND USING INFORMATION</h2>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p><span class=\"font-weight-heavy\">Account Creation.</span> We collect the information you provide to us when you create or update your account, including your name, address, telephone number, email address, user ID, user name, and credit card or other payment information.  We may use this information to contact you regarding the Service, and otherwise as described in this Privacy Policy. Any personally identifiable information which you include in your publicly-available user profile or submit to publicly-accessible portions of the Service will be visible to the public (or portions of the public).</p>&#10;      <p><span class=\"font-weight-heavy\">Login and Browsing.</span> We may collect information regarding your IP address, ISP, location, web-browser and the types of services and products you view on the Service.  We may use this information to customize your experience, including offering you products or services.</p>&#10;      <p><span class=\"font-weight-heavy\">Cookies and Similar Technologies.</span> We may use “cookies” on the Service (or similar technologies such as web beacons).  Cookies are small computer files we place on your computer’s hard drive so we can recognize your computer and collect information such as your IP address, login, password, your browsing patterns on the Service, and other information regarding your computer and your use of the Service.  The Help portion of the toolbar on most browsers will tell you how to restrict cookies or disable them altogether.  However, restricting or disabling cookies may prevent you from using some of the features of the Service.  We may allow advertisements to be displayed on the Service, in which case the advertisements and the third parties responsible for the advertisements may also such cookies and similar technologies.  This privacy policy covers the use of cookies by us and does not cover the use of cookies or other tracking technologies by such advertisers or any other third party.</p>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>Anything you put on your public profile will be public. We may use information that you give us to customize our communication with you and your experience on the site.  If you login through a Facebook account, we can access that info, too.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p><span class=\"font-weight-heavy\">Social Sharing Functions.</span></p>&#10;        <ul>&#10;          <li>&#10;            <p>We offer you the ability to share your activities on the Service with your friends and other third parties via third-party websites and services (e.g. Facebook). If you choose to share information about your activities in this manner, you are providing us the right to share the information with these third parties.</p>&#10;          </li>&#10;          <li>&#10;            <p>We collect the information you upload or include in your user profile. This information is publicly visible to other users of the Services and may include your username, profile image, biographical information, links to your personal website(s), images you upload to the Service, as well as your comments, posts, and reviews in our forum, blog, Course review and any other social pages on the Service.</p>&#10;          </li>&#10;          <li>&#10;            <p>If you login to the Service using a third party Authentication Service (such as Facebook Connect), or use an image from your Facebook, Twitter or other social media website account as your profile picture on the Service, you give us permission to access your account information on those websites. You should review your privacy settings on those sites to see what information you share with us in this manner. </p>&#10;          </li>&#10;          <li>&#10;            <p>If you do not want your personal information to be visible to other users of the Service, do not upload that information to your user profile or other public portions of the Service such as Galleries.</p>&#10;          </li>&#10;        </ul>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>If you want to share something about your CL experience on FB through us, you give us permission to do that.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p><span class=\"font-weight-heavy\">Our Use of Information.</span> We may use the information we collect on or through the Service to provide and improve the Service, to customize and improve your experience with the Service, and collect any applicable fees related to the Service.  We may also send you news, updates and other information you may find useful, unless you specify in your account that you do not want to receive these notices.</p>&#10;      <p>If you use the Service to send any personally identifiable information to a third party (such as another user of the Service), then we may send such information to such third party through the Service as directed.</p>&#10;      <ul>&#10;        <li class=\"list-unstyled\">&#10;          <p><span class=\"font-weight-heavy\">Advertising Communications.</span> We also offer you the ability to receive commercial communications relating to the Service, in which case we will use your account information to provide such communications. You may opt-out at any time by changing your settings in your account.</p>&#10;        </li>&#10;        <li class=\"list-unstyled\">&#10;          <p><span class=\"font-weight-heavy\">Opt-out of Advertising.</span>We send emails or other communications regarding our services. If you no longer wish to receive them, you can opt-out at any time by: (i) clicking the opt-out/unsubscribe option contained in each commercial email; (ii) going to your account information and changing your communication preference settings; or (iii) emailing at us at support@creativelive.com. Please note that it may take up to 48 hours for the system to fully update your preferences. Opting out of these communications will not impact emails or other communications we send you regarding your use of the Service (orders, policies, updates, etc.).</p>&#10;        </li>&#10;      </ul>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>We’ll get social from time to time. You have choices.  You can modify your account information and opt-out of emails or communications.  We won’t take it personally.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p><span class=\"font-weight-heavy\">Third Party Information Sharing.</span>From time to time, we share the personal information we collect with trusted companies who work with or on behalf of us. We may also combine personal information with publicly available information and information we receive from or cross-reference with our partners. These companies may use your personal information to enhance and personalize your shopping experience with us, to communicate with you about products and events that may be of interest to you and for other promotional purposes. Information sharing allows us to introduce new resources based on your interests and needs. With that in mind, when you purchase an item, your customer information may be shared with other select companies whose products and services you may find useful and those select companies will handle, store, retain, use, share and access personal information in accordance with their own privacy policies, and we disclaim any and all liability relating thereto.</p>&#10;      <ul>&#10;        <li class=\"list-unstyled\">&#10;          <p><span class=\"font-weight-heavy\">Opt-out of Third Party Information Sharing.</span>We understand and respect that not all customers may want to allow us to share their information with other select companies. If you do not want us to share your information, please contact us through the Contact Us page or at support@creativelive.com, and we will remove your name from lists we share with other companies as soon as reasonably practicable. When contacting us, please clearly state your request, including your name, mailing address, email address and phone number.</p>&#10;        </li>&#10;        <li class=\"list-unstyled\">&#10;          <p><span class=\"font-weight-heavy\">Compliance with Law Disclosure.</span>We may, however, disclose personally identifiable information when we believe disclosure is appropriate for any of the following purposes:  to comply with the law or a request by law enforcement officials or judicial authorities; to enforce or apply our Terms or other agreements; or to protect the rights, property, or safety of us, our customers or others.</p>&#10;        </li>&#10;        <li class=\"list-unstyled\">&#10;          <p><span class=\"font-weight-heavy\">Successors in Interest.</span>In the event that all or part of our business may be acquired by a third party, we may disclose personally identifiable information in connection with that transaction.</p>&#10;        </li>&#10;      </ul>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>We won’t sell your information.  We will only disclose your information when third parties assist us in providing service to you, to introduce you to services/products that you may enjoy based on your interests, if a company buys us and wants to continue our service to you, or when the law requires disclosure.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p><span class=\"font-weight-heavy\">User-Generated Feedback.</span>We value hearing from our users, and are always interested in learning about ways we can make CreativeLive better than ever. Any feedback, comments, reviews, ideas or suggestions (“Feedback”) to CreativeLive regarding CreativeLive's Site, Courses, or Services is entirely voluntary. Any such Feedback that you provide to will be the sole and exclusive property of CreativeLive and you hereby irrevocably assign to us all of your right, title and interest in and to all Feedback.  CreativeLive will be free to use such Feedback as we see fit and without any obligation to you.</p>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>We love when you share the love, so we may use your feedback to improve our services and for marketing purposes.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">CALIFORNIA DO NOT TRACK NOTICE</p>&#10;      <p>We do not collect personally identifiable information about your online activities over time and across third-party websites or online services, and therefore do not respond to “do not track” signals or other mechanisms that allow consumers to exercise choice regarding this type of activity.</p>&#10;      <p>Third parties that serve or display advertisements on the Service may collect personally identifiable information about your online activities over time and across different websites when you use the Service.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">LINKS</p>&#10;      <p>The Service may contain links to third party websites that collect and use information in accordance with their own privacy policies, which you should read.  We have no control over, and are not responsible for, the privacy practices or content of these third parties.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">CHILDREN</p>&#10;      <p>No one under 18 years of age is authorized to use the Service, and we do not intentionally collect information from anyone under the age of 18.</p>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>You must be 18 to use our site.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">YOUR PREFERENCES</p>&#10;      <p><span class=\"font-weight-heavy\">Modifying Your Information.</span>You can modify your account information at any time by logging into your account, clicking on “My Account”, and then the “Edit Contact Information” link. In addition, you may modify any personal information in your user profile at any time.  We may keep a copy of the prior version of this information for our records. If you have questions about how to modify or remove your account information, please email <a href=\"mailto:support@creativelive.com\">support@creativelive.com</a>.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">SECURITY</p>&#10;      <p>Protecting our users’ information is very important to us. While we take reasonable security measures with regard to the personally identifiable information under our control, no security measures are 100% secure, and we cannot guarantee the security of any user’s information.</p>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>We work very hard to protect your personal information, but we cannot guarantee 100% protection.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">INTERNATIONAL VISITORS</p>&#10;      <p>The Service is provided and operated solely from the United States of America.  If you submit any personal information to the Service from outside the United States, you hereby consent to the transfer of such information to (and the processing of such information in) the United States, and the exclusive application of the laws of the State of Washington, United States, with regard to the collection and use of such information.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div class=\"col-sm-8\">&#10;      <p class=\"text-uppercase font-weight-heavy\">CHANGES</p>&#10;      <p>We may amend this Privacy Policy at any time by posting the modified Privacy Policy on the Service.  The modifications will be effective upon such posting (unless a later date is specified in the posting, in which case that date shall be deemed the effective date of the modifications).  You agree to review this Privacy Policy periodically so that you are aware of any modifications.  Your continued use of the Service after such modifications constitutes your acknowledgment of, and agreement to be bound by, the amended Privacy Policy.  Please review the Privacy Policy prior to submitting personal information on or through the Service.</p>&#10;    </div>&#10;    <div class=\"col-sm-4\">&#10;      <h4 class=\"margin-top-none\">Let’s get real:</h4>&#10;      <p>This information can change and any changes will be posted here.  Keep up to date with the changes as you are legally bound by this policy.</p>&#10;    </div>&#10;  </div>&#10;  <div class=\"row\">&#10;    <div